// src/components/LandingPage.js
import React from 'react';
import { Link } from 'react-router-dom';

const LandingPage = () => {
    return (
        <div>
            <h1>Welcome to CrickBidders</h1>
            <nav>
                <Link to="/signup">Sign Up</Link> | <Link to="/login">Log In</Link>
            </nav>
        </div>
    );
};

export default LandingPage;
